import React, { Component } from 'react';
import { Button } from "mdbreact";
import logo from './logo.png';

class App extends Component {
  render() {
    return (
      //Navigation//
    <div>
        <a class="menu-toggle rounded" href="#">
            <i class="fas fa-bars fa-3x text-white"></i>
        </a>

            <ul className="sidebar-nav">
                <li className="sidebar-brand">
                    <a className="js-scroll-trigger">Menu</a>
                </li>
                <li className="sidebar-nav-item">
                    <a className="js-scroll-trigger" href="index.php">Home</a>
                </li>
                <li className="sidebar-nav-item">
                    <a className="js-scroll-trigger" data-toggle="modal" data-target="#login-modal">Login</a>
                </li>
                <li className="sidebar-nav-item">
                    <a className="js-scroll-trigger" data-toggle="modal" data-target="#register-modal">Register</a>
                </li>
                <li className="sidebar-nav-item">
                    <a className="js-scroll-trigger" href="about.php">About</a>
                </li>             
                <li className="sidebar-nav-item">
                    <a className="js-scroll-trigger" href="checkout.php">Payment</a>
                </li>
                <li className="sidebar-nav-item">
                    <a className="js-scroll-trigger" href="#">Help & Support</a>
                </li>

            </ul>

        </div>
    );
  }
};





// Landing Page side menu//
(function($) {
  "use strict"; // Start of use strict

  // Closes the sidebar menu
  $(".menu-toggle").click(function(e) {
    e.preventDefault();
    $("#sidebar-wrapper").toggleClass("active");
    $(".menu-toggle > .fa-bars, .menu-toggle > .fa-times").toggleClass("fa-bars fa-times");
    $(this).toggleClass("active");
  });

  // Smooth scrolling using jQuery easing
  $('a.js-scroll-trigger[href*="#"]:not([href="#"])').click(function() {
    if (location.pathname.replace(/^\//, '') === this.pathname.replace(/^\//, '') && location.hostname === this.hostname) {
      var target = $(this.hash);
      target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
      if (target.length) {
        $('html, body').animate({
          scrollTop: target.offset().top
        }, 1000, "easeInOutExpo");
        return false;
      }
    }
  });

  // Closes responsive menu when a scroll trigger link is clicked
  $('#sidebar-wrapper .js-scroll-trigger').click(function() {
    $("#sidebar-wrapper").removeClass("active");
    $(".menu-toggle").removeClass("active");
    $(".menu-toggle > .fa-bars, .menu-toggle > .fa-times").toggleClass("fa-bars fa-times");
  });

  // Scroll to top button appear
  $(document).scroll(function() {
    var scrollDistance = $(this).scrollTop();
    if (scrollDistance > 100) {
      $('.scroll-to-top').fadeIn;
    } else {
      $('.scroll-to-top').fadeOut;
    }
  });

})(jQuery); // End of use strict

$('#landingbanner').animatescroll({scrollSpeed:2000,easing:'easeOutBounce'});

export default App;
